STUB_VFILE = "stub_vfile.txt"
STUB_EFILE = "stub_efile.txt"

random.seed(30)


def nested_set(nested_structure):
    return {frozenset(i) for i in nested_structure}

def nested_list(nested_structure):
    return [list(i) for i in nested_structure]

def read_cases(filename, has_result=False):
    cases = []
    with open(filename) as f:
        f.seek(0, 2)
        end = f.tell()
        f.seek(0)
        while f.tell() < end:
            line = f.readline().strip()
            while line.isspace():
                line = f.readline().strip()
            case = {"case": line}
            if has_result:
                case["result"] = nested_set(eval(f.readline().strip()))
            for dtype in ["vfile", "efile"]:
                while not line.isnumeric():
                    line = f.readline().strip()
                data = []
                for _ in range(int(line)):
                    x, y = f.readline().split()
                    data.append((int(x), int(y)))
                case[dtype] = data
                line = f.readline().strip()
            cases.append(case)
    return cases

def write_to_file(filename, data, mode="w"):
    with open(filename, mode) as f:
        f.write(str(len(data)))
        for x, y in data:
            f.write(f"\n{x} {y}")

def format_msg_q2(graph, crossing_time, transform_cost, start, end):
    graph = f"Case: {graph}"
    crossing_time = f"Crossing time: {crossing_time}"
    transform_cost = f"Transform cost: {transform_cost}"
    start = f"Start: {start}"
    end = f"End: {end}"
    return [graph, crossing_time, transform_cost, start, end]

def gen_random_graph(case_name, file, mode="a", solve_q1=False, bound=100, write_stub=False):
    vfile = [(i, random.randrange(3)) for i in range(random.randrange(3, bound))]
    random.shuffle(vfile)
    efile = {frozenset({vfile[i][0], vfile[i + 1][0]}) for i in range(len(vfile) - 1)}
    if write_stub or solve_q1:
        write_to_file(STUB_VFILE, vfile)
        write_to_file(STUB_EFILE, efile)
        if solve_q1:
            result = captured_chains(STUB_VFILE, STUB_EFILE)
    with open(file, mode) as f:
        f.write(f"\n{case_name}\n")
        if solve_q1:
            f.write(f"{result}\n")
        f.write("vfile\n")
    write_to_file(file, vfile, "a")
    with open(file, "a") as f:
        f.write("\n\nefile\n")
    write_to_file(file, efile, "a")
    with open(file, "a") as f:
        f.write("\n")
    return vfile, efile

def gen_random_case_q2(case_name, file, mode="a", bound=100):
    vfile, efile = gen_random_graph(case_name, file, mode, bound=bound, write_stub=True)
    terrains = ["plain", "hill", "swamp"]
    forms = ["wheel", "tank", "hover"]
    crossing_time = {f:{t: random.randrange(1, bound) for t in terrains} for f in forms}
    input_cases = [(random.randint(1, bound), random.randrange(len(vfile)), random.randrange(len(vfile))) for _ in range(bound)]
    input_cases = [(case, terrain_pathfinding(STUB_VFILE, STUB_EFILE, crossing_time, *case)[0]) for case in input_cases]
    return {"crossing_time": crossing_time, "input_cases": input_cases}


class TestAssignment4(unittest.TestCase):
    @classmethod
    def tearDownClass(cls):
        os.remove(STUB_VFILE)
        os.remove(STUB_EFILE)

    def validate_path(self, result, vertices, edges, crossing_time, transform_cost, start, end, msg):
        expected, path = result
        if start == end:
            return self.assertEqual(
                (0, []),
                result,
                msg="\n".join(msg + ["Incorrect path taken when start == end"])
            )
        else:
            self.assertEqual(
                start,
                path[0][0],
                msg="\n".join(msg + ["Path starts from wrong position"])
            )
            self.assertEqual(
                end,
                path[-1][0],
                msg="\n".join(msg + ["Path ends at wrong position"])
            )
        terrains = ["plain", "hill", "swamp"]
        vlist = [v for (v, _) in path]
        self.assertEqual(len(set(vlist)), len(vlist), msg="\n".join(msg + ["Repeated vertex in path"]))
        time_taken = crossing_time[path[0][1]][terrains[vertices[start][1]]]
        if path[0][1] != "wheel":
            time_taken += transform_cost
        for i, (vertex, vehicle_form) in enumerate(path[1:len(path)-1], 1):
            prev_vertex, prev_form = path[i - 1]
            self.assertIn(
                {prev_vertex, vertex},
                edges,
                msg="\n".join(msg + [f"Edge {(prev_vertex, vertex)} does not exist"])
            )
            if vehicle_form != prev_form:
                time_taken += transform_cost
            time_taken += crossing_time[vehicle_form][terrains[vertices[vertex][1]]]
        self.assertEqual(
            expected,
            time_taken,
            msg="\n".join(msg + ["Path does not result in the expected minimal time taken"])
        )

